import { useNavigate } from "react-router-dom";
import { useAuth } from "../../hooks/useAuth";

const Home = () => {
  const { user } = useAuth();
  const navigate = useNavigate();
  if (user) {
    return (
      <div>
        <h1>Home Page</h1>
        <h2>{user ? `Welcome ${user.name}` : ""}</h2>
      </div>
    );
  } else {
    navigate("/login");
  }
};

export default Home;
